import React from "react";
import styled from "styled-components";
import tw from "twin.macro";

const Navbar = styled.ul`
  ${tw`
  my-4
  w-screen
  flex
  px-4
`};
`;

const Logo = styled.li`
  ${tw`
  w-full
  justify-self-start
  text-3xl
  font-medium
`};
`;

const NavComponents = styled.li`
  ${tw`
  w-full
  justify-self-end
  flex
  justify-end
  space-x-4
`};
`;

const App = () => {
  return (
    <Navbar>
      <Logo>LOGO</Logo>
      <NavComponents>
        <a href="#">Item 1</a>
        <a href="#">Item 2</a>
        <a href="#">Item 3</a>
        <a href="#">Item 4</a>
      </NavComponents>
    </Navbar>
  );
};

export default App;
